usage.html.body:
Usage
Prerequisite
There are WIP to deploy Trevas into Maven central repository.
While waiting for this step, you can use it locally:
git clone https://github.com/InseeFr/Trevas.git
cd Trevas
mvn package

You have to add it finally to your classpath.
Importing into Maven project
Trevas engine has to be added to your project into your pom.xml:

    fr.insee.trevas
    vtl-engine
    x.y.z


Engine usage
To instantiate VTL 2.0 engine, we simply have to create a ScriptEngine:
ScriptEngine engine = new ScriptEngineManager().getEngineByName("vtl");

If we want to add input bindings, do it as follow:
ScriptContext context = engine.getContext();
context.setBindings(jsonBindings, ScriptContext.ENGINE_SCOPE);

To execute the script and get results, just do:
try {
    engine.eval(script);
    Bindings outputBindings = context.getBindings(ScriptContext.ENGINE_SCOPE);
    response.send(outputBindings);
} catch (ScriptException e) {
    processErrors(e, request, response);
}

Where processErrors can be for instance:
private  T processErrors(Throwable ex, ServerRequest request, ServerResponse response) {
    LOGGER.log(Level.FINE, "Error", ex);
    if (ex instanceof VtlScriptException) {
        JsonObject jsonErrorObject = JSON.createObjectBuilder()
                .add("error", ex.getMessage())
                .build();
        response.status(Http.Status.BAD_REQUEST_400).send(jsonErrorObject);
    }

    JsonObject jsonErrorObject = JSON.createObjectBuilder()
            .add("error", ex.getMessage())
            .build();
    response.status(Http.Status.INTERNAL_SERVER_ERROR_500).send(jsonErrorObject);

    return null;
}

Dataset serialization
Instead of dealing yourself with Dataset objects, defined into Trevas Model module, a dedicated module based on Jackson is available into Trevas.
Dependencies

    fr.insee.trevas
    vtl-jackson
    x.y.z
    compile


    com.fasterxml.jackson.core
    jackson-databind
    2.11.2


Initialization of Jackson Mapper
Thanks to the module, it's possible to register once the Trevas Jackson module in your application:
ObjectMapper mapper = new ObjectMapper();
mapper.registerModule(new TrevasModule());

Giving it to your webserver, Dataset, Component, Bindings will be serialized/deserialized automatically.
Bindings JSON model
Scalar objects & datasets are enabled into JSON bindings.
To include a Dataset, you have to respect the following model:
{
    "dataStructure": [
        {"name": "my_name", "type": "STRING", "role": "IDENTIFIER"},
        {"age": "my_age", "type": "INTEGER", "role": "MEASURE"},
    ],
    "dataPoints": [
        ["name1", 20],
        ["name2", 30],
        ...
    ]
}

Types have to be one of: STRING, INTEGER, NUMBER, BOOLEAN.
Roles have to be one of: IDENTIFIER, MEASURE, ATTRIBUTE.

engine/.body:
VTL Engine
Dépendance

    fr.insee.trevas
    vtl-engine
    0.1.0-SNAPSHOT


Instanciation du moteur d'exécution
Le moteur d'exécution répondant à la norme Script Engine, il est instanciable via l'instruction suivante :
ScriptEngine engine = new ScriptEngineManager().getEngineByName("vtl");

Variable entrantes
Des variables peuvent être déclarées en entrée du moteur, en les affectant sous forme de clé / valeur au sein d'un objet Bindings.
Bindings bindings = new SimpleBindings(Map.of("a", 1));
ScriptContext context = engine.getContext();
context.setBindings(bindings, ScriptContext.ENGINE_SCOPE);

Exécution d'un script
// la variable 'a' sera recherchée dans les bindings du moteur
String script = "res := a + 1;";
try {
    engine.eval(script);
} catch (ScriptException e) {
    e.printStackTrace();
}

Récupération des résultats
L'ensemble des variables, entrantes ou créées sont accessibles via le context du moteur :
Bindings outputBindings = engine.getContext().getBindings(ScriptContext.ENGINE_SCOPE);

Il est alors possible d'accéder à l'une d'elles en particulier :
outputBindings.get("res");

Dataset
Les tables de données sont représentées sous forme de Dataset.
Les Dataset sont composés d'une dataStructure et de dataPoints.
Les dataStructure sont composées de Component, ayant un name, un role et un type.
Les valeurs des variables ayant pour rôle IDENTIFIER des dataPoints doivent être uniques.
Deux instances de Dataset sont exposées :

InMemoryDataset : permet de définir un Dataset au sein de la JVM (voir en détail)
SparkDataset : permet de définir un Dataset à transférer à Spark (voir en détail)

engine/in-memory.html.body:
Dataset - InMemory
Les datasets InMemoryDataset permettent de représenter les tables statistiques dans une application Java.
Exemple
ScriptEngine engine = new ScriptEngineManager().getEngineByName("vtl");

Bindings bindings = new SimpleBindings();

// Par défaut, si le rôle d'une variable n'est pas défini, le rôle `MEASURE` lui sera affecté.
InMemoryDataset dataset = new InMemoryDataset(
                List.of(
                        Map.of("var1", "x", "var2", "y", "var3", 5),
                        Map.of("var1", "xx", "var2", "yy", "var3", 10)
                ),
                Map.of("var1", String.class, "var2", String.class, "var3", Long.class),
                Map.of()
);

bindings.put("dataset", dataset);

ScriptContext context = engine.getContext();
context.setBindings(bindings, ScriptContext.ENGINE_SCOPE);

String script = "res := dataset[filter var3 > 6];";

try {
    engine.eval(script);
} catch (ScriptException e) {
    e.printStackTrace();
}

Bindings outputBindings = engine.getContext().getBindings(ScriptContext.ENGINE_SCOPE);

InMemoryDataset res = (InMemoryDataset) outputBindings.get("res");

engine/spark.html.body:
Dataset - Spark
Les datasets SparkDataset permettent de représenter les tables statistiques dans une application Java, délégant les calculs à un cluster Spark.
Utilisation

ajouter les dépendances Trevas / Spark requises
instancier une session Spark
instancier un moteur d'éxecution Trevas / Spark
créer des sources de données Spark et les introduire dans le moteur Trevas sous forme de SparkDataset

Dépendances

    fr.insee.trevas
    vtl-engine
    0.1.0-SNAPSHOT


    fr.insee.trevas
    vtl-spark
    0.1.0-SNAPSHOT



    org.apache.spark
    spark-kubernetes_2.12
    3.0.1


Session Spark
Local
SparkSession.Builder sparkBuilder = SparkSession.builder()
        .appName("my-app")
        .master("local");

SparkSession spark = sparkBuilder.getOrCreate();

Standalone
Installer un cluster Spark standalone
Le cluster Spark peut être installé dans n'importe quel environnement.
Par exemple, pour en installer un dans un cluster Kubernetes via Helm :
helm install my-spark bitnami/spark --set image.repository=inseefrlab/spark --set image.tag=latest

Instancier la session Spark
SparkSession.Builder sparkBuilder = SparkSession.builder()
        .appName("vtl-lab")
        // my-spark est le nom donné précédemment à votre cluster
        .master("spark://my-spark-master-svc:7077");

// Activer l'allocation dynamique d'exécuteur (optionnel)
sparkBuilder.config("spark.dynamicAllocation.enabled", true);
sparkBuilder.config("spark.dynamicAllocation.shuffleTracking.enabled", true);
// Nombre d'exécuteurs minimum
sparkBuilder.config("spark.dynamicAllocation.minExecutors", 10);

// Connection à un datalake HDFS de type s3
sparkBuilder.config("spark.hadoop.fs.s3a.access.key", sparkProperties.getAccessKey());
sparkBuilder.config("spark.hadoop.fs.s3a.secret.key", sparkProperties.getSecretKey());
sparkBuilder.config("spark.hadoop.fs.s3a.connection.ssl.enabled", sparkProperties.getSslEnabled());
sparkBuilder.config("spark.hadoop.fs.s3a.session.token", sparkProperties.getSessionToken());
sparkBuilder.config("spark.hadoop.fs.s3a.endpoint", sparkProperties.getSessionEndpoint());

// Transférer les dépendances Trevas aux exécuteurs Spark
// Voir https://stackoverflow.com/questions/28079307
sparkBuilder.config("spark.jars", String.join(",",
        "/vtl-spark.jar",
        "/vtl-model.jar",
        "/vtl-jackson.jar",
        "/vtl-parser.jar",
        "/vtl-engine.jar"
));

SparkSession spark = sparkBuilder.getOrCreate();

Kubernetes
Plutôt que de se connecter à une instance Spark préalablement installée (mode standalone), Kubernetes permet d'orchestrer l'exécution d'un job Spark au sein du cluster.
Service account
Afin que l'application cliente, requêtant le cluster Kubernetes pour lancer un job Spark, puisse obtenir les droits pour déployer les services nécessaires au lancement du job, un service account doit être configuré :

serviceaccount.yml

Déclarer le service account associé à un namespace Kubernetes
apiVersion: v1
kind: ServiceAccount
metadata:
  name: my-service-account
  namespace: my-namespace


role.yml

Déclarer les rôles associés à un namespace Kubernetes
apiVersion: rbac.authorization.k8s.io/v1
kind: Role
metadata:
  name: my-role
  namespace: my-namespace
rules:
  - apiGroups:
      - ""
    resources:
      - "pods"
      - "services"
      - "configmaps"
    verbs:
      - "list"
      - "create"
      - "delete"
      - "watch"
      - "update"
      - "get"
      - "patch"


role-bindings.yml

Associer le service account et le rôle dans le namespace Kubernetes
apiVersion: rbac.authorization.k8s.io/v1
kind: RoleBinding
metadata:
  name: my-role-bindings
subjects:
  - kind: ServiceAccount
    name: my-service-account
    namespace: my-namespace
roleRef:
  kind: Role
  name: my-role
  apiGroup: rbac.authorization.k8s.io


deployment.yml

Définir le service account à utiliser dans l'application Java cliente
[...]
spec:
  template:
    spec:
      serviceAccountName: vtl-lab-sa
[...]

Configuration de la session Spark Kubernetes
SparkSession.Builder sparkBuilder = SparkSession.builder()
                .appName("my-app")
                .master("k8s://https://kubernetes.default.svc.cluster.local:443");

// Image docker déployée pour le driver et les exécuteurs
sparkBuilder.config("spark.kubernetes.container.image.pullPolicy", sparkProperties.getKubernetesContainerImagePullPolicy());
sparkBuilder.config("spark.kubernetes.container.image", sparkProperties.getKubernetesContainerImage());

// Configuration de l'instance Spark à déployer dans le cluster Kubernetes
sparkBuilder.config("spark.kubernetes.namespace", sparkProperties.getKubernetesNamespace());
sparkBuilder.config("spark.kubernetes.executor.request.cores", sparkProperties.getKubernetesExecutorRequestCores());
sparkBuilder.config("spark.kubernetes.driver.pod.name", sparkProperties.getKubernetesDriverPodName());

// Activer l'allocation dynamique d'exécuteur (optionnel)
sparkBuilder.config("spark.dynamicAllocation.enabled", true);
sparkBuilder.config("spark.dynamicAllocation.shuffleTracking.enabled", true);
// Nombre d'exécuteurs minimum
sparkBuilder.config("spark.dynamicAllocation.minExecutors", 10);

// Connection à un datalake HDFS de type s3
sparkBuilder.config("spark.hadoop.fs.s3a.access.key", sparkProperties.getAccessKey());
sparkBuilder.config("spark.hadoop.fs.s3a.secret.key", sparkProperties.getSecretKey());
sparkBuilder.config("spark.hadoop.fs.s3a.connection.ssl.enabled", sparkProperties.getSslEnabled());
sparkBuilder.config("spark.hadoop.fs.s3a.session.token", sparkProperties.getSessionToken());
sparkBuilder.config("spark.hadoop.fs.s3a.endpoint", sparkProperties.getSessionEndpoint());

// Transférer les dépendances Trevas aux exécuteurs Spark
// Voir https://stackoverflow.com/questions/28079307
sparkBuilder.config("spark.jars", String.join(",",
        "/vtl-spark.jar",
        "/vtl-model.jar",
        "/vtl-jackson.jar",
        "/vtl-parser.jar",
        "/vtl-engine.jar"
));

SparkSession spark = sparkBuilder.getOrCreate();

Moteur d'exécution Trevas / Spark
Par défaut, un engine Trevas résoud les traitements InMemory.
Afin d'activer la résolution via Spark, deux propriétés sont à valoriser :
ScriptEngine engine = new ScriptEngineManager().getEngineByName("vtl");
ScriptContext context = engine.getContext();
context.setBindings(bindings, ScriptContext.ENGINE_SCOPE);
engine.put("$vtl.engine.processing_engine_names", "spark");
engine.put("$vtl.spark.session", spark);

SparkDataset
Afin d'instancier un SparkDataset Trevas, une source de données Spark et un fichier json décrivant la structure des données sont requis.
Source de données Spark
L'API Spark permet de créer des Dataset depuis plusieurs format : parquet, avro, json, csv, jdbc, ...
Parquet
Dataset dataset = spark.read().parquet("path/to/parquet/folder");

Structure des données
Format
[
  { "name": "id", "type": "STRING", "role": "IDENTIFIER" },
  { "name": "x", "type": "INTEGER", "role": "MEASURE" },
  { "name": "y", "type": "FLOAT", "role": "MEASURE" }
]

Sérialisation
List components =
objectMapper.readValue(Paths.get("path/to/structure.json")
                .toFile(),
        new TypeReference<>() {
        });
Structured.DataStructure structure = new Structured.DataStructure(components);

Instanciation du SparkDataset
SparkDataset dataset = new SparkDataset(dataset, structure);
